comment_data.body:
For a Cython type it looks like `PyMapping_Check` will give true any time `__getitem__` is defined:
```cython
from cpython cimport PyMapping_Check

cdef class poly:

    def __getitem__(self, key):
        pass

    def check(self):
        return PyMapping_Check(self)
```

